import Register from "./components/pages/auth/Register";
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <h1>Hello CodeSandbox</h1>
      <Routes>
        <Route path="/register" element={<Register />} />
      </Routes>

    </div>
  );
}

export default App;
